// src/pages/Profile/ProfilePage.jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ProfilePage.css';

const ProfilePage = () => {
  const [profile, setProfile] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  
  // Form state for editing the profile
  const [formData, setFormData] = useState({
    name: '',
    avatar: '',
    headline: '',
    summary: '',
    connectionsCount: 0,
    // For simplicity, we won't edit experience and education in this demo
    experience: [],
    education: []
  });

  // Assume userId and username are stored in localStorage (or obtained via auth context)
  const userId = localStorage.getItem('userId') || 'defaultUserId';

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/profile?userId=${userId}`);
        if (response.data.success) {
          setProfile(response.data.data);
          setFormData({
            name: response.data.data.name || '',
            avatar: response.data.data.avatar || '',
            headline: response.data.data.headline || '',
            summary: response.data.data.summary || '',
            connectionsCount: response.data.data.connectionsCount || 0,
            experience: response.data.data.experience || [],
            education: response.data.data.education || []
          });
        } else {
          setError('Profile not found.');
        }
      } catch (err) {
        console.error('Error fetching profile:', err);
        setError('Error fetching profile.');
      } finally {
        setLoading(false);
      }
    };

    fetchProfile();
  }, [userId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.put('http://localhost:5000/api/profile', {
        userId,
        ...formData
      });
      if (response.data.success) {
        alert('Profile updated successfully!');
        // Optionally re-fetch profile data
      } else {
        setError('Update failed.');
      }
    } catch (err) {
      console.error('Error updating profile:', err);
      setError('Error updating profile.');
    }
  };

  if (loading) return <p>Loading profile...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div className="profile-page container">
      <div className="profile-header">
        <img src={profile.avatar} alt={profile.name} className="profile-avatar" />
        <div className="profile-info">
          <h1>{profile.name}</h1>
          <p className="headline">{profile.headline}</p>
          <p>{profile.summary}</p>
          <p>{profile.connectionsCount} Connections</p>
        </div>
      </div>
      <section className="profile-section">
        <h2>Edit Profile</h2>
        <form onSubmit={handleSubmit} className="profile-form">
          <div className="form-group">
            <label>Name:</label>
            <input type="text" name="name" value={formData.name} onChange={handleChange} />
          </div>
          <div className="form-group">
            <label>Avatar URL:</label>
            <input type="text" name="avatar" value={formData.avatar} onChange={handleChange} />
          </div>
          <div className="form-group">
            <label>Headline:</label>
            <input type="text" name="headline" value={formData.headline} onChange={handleChange} />
          </div>
          <div className="form-group">
            <label>Summary:</label>
            <textarea name="summary" value={formData.summary} onChange={handleChange}></textarea>
          </div>
          <div className="form-group">
            <label>Connections Count:</label>
            <input type="number" name="connectionsCount" value={formData.connectionsCount} onChange={handleChange} />
          </div>
          <button type="submit" className="btn btn-primary">Save Changes</button>
        </form>
      </section>
    </div>
  );
};

export default ProfilePage;
